INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (17, 'HOY | Contacto por producto {{CODIGO_PRODUCTO}} en {{PROPIEDAD_NOMBRE}}', 'Alerta por comunicaciones próximas', '<p>Te recordamos que hoy tenés que comunicarte con el cliente {{CLIENTE_NOMBRE}} por el producto {{CODIGO_PRODUCTO}} en {{PROPIEDAD_NOMBRE}}</p>', 0);
INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (18, 'Alerta por cuotas vencidas', 'Alerta por cuotas vencidas en los últimos 7 días', '<p>Estimado {{CLIENTE_NOMBRE}}:</p><p><br></p><p>Tiene cuotas vencidas:</p><p>{{CLIENTE_CUIT}}</p><p>{{CUOTA_VALOR}} {{CUOTA_MONEDA}}</p><p>Venció el {{CUOTA_VENCIMIENTO}}</p>', 0);
INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (19, 'Alerta de cuotas por vencer', 'Alerta por cuotas a vencer en 7 días', '<p>Estimado {{CLIENTE_NOMBRE}}:</p><p><br></p><p>El {{CUOTA_VENCIMIENTO}} vence la cuota n° {{CUOTA_NRO}} de su propiedad en {{PROPIEDAD_NOMBRE}} con n° codigo {{CODIGO_PRODUCTO}} por un importe de&nbsp;{{CUOTA_VALOR}} {{CUOTA_MONEDA}}</p><p>&nbsp;</p><p>Ante cualquier inconveniente, comunicate con nosotros</p><p>&nbsp;</p><p>Saludamos atte.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>NOTA: El capital en mora devengará un interés punitorio desde la fecha de vencimiento hasta efectivizar el pago.</p>', 0);
INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (20, 'Alerta de cuotas que vencen hoy', 'Alerta por vencimiento de cuotas en el día', '<p>Estimado {{CLIENTE_NOMBRE}}:</p><p><br></p><p>Hoy vence la cuota n° {{CUOTA_NRO}} de su propiedad en {{PROPIEDAD_NOMBRE}} por un importe de&nbsp;{{CUOTA_VALOR}}&nbsp;{{CUOTA_MONEDA}}. Recordamos que el capital en mora devengará un interés punitorio desde el día de la fecha hasta efectivizar el pago.</p><p>&nbsp;</p><p>Ante cualquier inconveniente, comunicate con nosotros</p><p>&nbsp;</p><p>Saludamos atte.</p>{{FIRMA_BU}}', 0);
INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (21, 'Alerta por Error en su Debi', 'Alerta por Debin Error', '<p>Estimado {{CLIENTE_NOMBRE}}:</p><p><br></p><p>Se ha registrado un error en el procesamiento del débito inmediato con código {{DEBIN_CODIGO}} por el pago de la cuota n°{{CUOTA_NRO}} en {{PROPIEDAD_NOMBRE}}.</p><p><br></p><p>Para más información, comunicate con nosotros.</p><p>Saludamos atte.</p>', 0);
INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (22, 'Alerta por Debin Cancelado', 'Alerta por Debin Cancelado', '<p>Estimado {{CLIENTE_NOMBRE}}:</p><p><br></p><p>El débito inmediato con código {{DEBIN_CODIGO}} por el pago de la cuota n° {{CUOTA_NRO}}&nbsp;en {{PROPIEDAD_NOMBRE}} ha sido cancelado.</p><p><br></p><p>Por cualquier consulta, comunicate con nosotros.</p><p>Saludamos atte.</p>', 0);
INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (23, 'Alerta por Debin Aprobado', 'Alerta por Debin Aprobado', '<p>Estimado {{CLIENTE_NOMBRE}}:</p><p><br></p><p>El débito inmediato con código {{DEBIN_CODIGO}} ha sido registrado con éxito en nuestra cuenta. Confirmamos el pago de la cuota n°{{CUOTA_NRO}} de la propiedad en {{PROPIEDAD_NOMBRE}}</p><p><br></p><p>Por cualquier consulta, comunicate con nosotros.</p><p>Saludamos atte.</p>{{FIRMA_BU}}', 0);
INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (24, 'Alerta de Debin Expirado', 'Alerta por Debin Expirado', '<p>Estimado {{CLIENTE_NOMBRE}}:</p><p><br></p><p>El débito inmediato con código {{DEBIN_CODIGO}}&nbsp;por el pago de la cuota n°{{CUOTA_NRO}} en {{PROPIEDAD_NOMBRE}} ha expirado.</p><p><br></p><p>Para más información, comunicate con nosotros.</p><p>Saludamos atte.</p>', 0);
INSERT INTO [Template] ([Id], [Subject], [Description], [HtmlBody], [Disabled]) VALUES (25, 'Alerta por Debin Rechazado', 'Alerta por Debin Rechazado', '<p>Estimado {{CLIENTE_NOMBRE}}:</p><p><br></p><p>Su debin con código {{DEBIN_CODIGO}} ha sido rechazado.</p><p>El débito inmediato con código {{DEBIN_CODIGO}} por el pago de la cuota n°{{CUOTA_NRO}} en {{PROPIEDAD_NOMBRE}} ha sido rechazado.</p><p><span style="color: red;"><span class="ql-cursor">﻿</span></span></p><p>Para más información, comunicate con nosotros a {{CORREO_BU}}.</p><p>&nbsp;</p><p>Saludamos atte.</p>', 0);
